import logo from "./logo.svg";
import "./App.css";
import Main from "./main";
import TransitionalPlanning from "./transitional-planning";
import AlternativePath from "./alternative-paths";
import Community from "./community"

function App() {
  return (
    <div className="App">
      <Main />
      <TransitionalPlanning />
      <Community />
      <AlternativePath />
    </div>
  );
}

export default App;
